import React from 'react';

function Lista( props) {  
    return (
        <div>
            <header className="App-header">      
                <h2>Ajopäiväkirja</h2>
                <p>
                  Nimi: { props.lomake[0] }  <br />
                </p>    
            </header>
        </div>
    );
  }

  export default Lista;
